import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import Zoo from './images/zoo.JPG'
const About = () => {
    return (
        <div className='text-center mt-2'>
            <h1 className='fw-bold'>About Us</h1>
            <img src={Zoo} alt="" />
        </div>
    )
}

export default About
